import React from "react";
import { FlatList, StyleSheet, View } from "react-native";

import AppText from "../components/AppText";
import Screen from "../components/Screen";
import colors from "../config/colors";

const dyeChoices = choices.dyeChoices;

function BudgetApp({navi}) {
    return (
      <Screen style={styles.screen}>
        <AppText style={styles.title}>List of Food Dyes</AppText>
        
        {dyeChoices.map(dye => (
          <AppText style={styles.text} key={dye.id}>{dye.label}</AppText>
        ))}

      
      </Screen>
    );
}

const styles = StyleSheet.create({
  screen: {
    flex: 1,
    backgroundColor: colors.light,
    justifyContent: "center",
    alignItems: "center",
  },
  container: {
    alignItems: "center",
    justifyContent: "center",
    padding: 10,
    backgroundColor: colors.light,
  },
  title: {
    color: colors.eltrdarkblue,
    fontSize: 40,
    marginBottom: 20,
    marginTop: 250,
  },
  
});

export default FoodDye;
